import ReactDOM from 'react-dom';
import './index.css'; // If you have global styles
import App from './App'; // Assuming you have an App.js component as the root of your React app

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
